import Link from 'next/link'
const About = () =>(
    <div>
        <li><Link href='/'><a>home</a></Link></li>
         <li><Link href='/about'><a>about</a></Link></li>
        <h2>About bitzPrice</h2>
        <p>Application to view bitz price</p>
     </div>
)

export default About;
